import React from 'react';

function HealthCare() {
  return (
    <div className="p-10 text-center">
      <h2 className="text-3xl font-bold mb-4 text-purple-700">HealthCare Industry</h2>
      <p className="text-gray-700">Explore how digital innovation is transforming healthcare operations and patient experiences.</p>
    </div>
  );
}

export default HealthCare;
